function nextStep() {
    this.reset();
    var count = parseInt(Math.max(5,Math.random()*20))
    $morph('Counter').setTextString(count);
    for (; count >0; count--) {
        var cords = this.newRectangleCords()
        var rect = $morph('ProtoRect').copy();
        rect.setPosition(pt(cords.x, cords.y));
        rect.setExtent(pt(cords.width , cords.height));
        this.addMorph(rect)
    }

}

