function newRectangleCords() {
    while(true) {
        var width = parseInt(Math.max(20,Math.random()*100)),
            height = parseInt(Math.max(20,Math.random()*100)),
            x = parseInt(Math.random()*this.getExtent().x),
            y = parseInt(Math.random()*this.getExtent().y);
        var cords = {x:x , y:y, width:width, height:height};
        if(!this.validRectangleCoords(cords))
            continue;       
        return cords;
    }
}
